import Home from "./routes/home/home.component";
import { Route, Routes, Outlet} from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I'm the navigation bar</h1>
      </div>
      <Outlet />
    </div>
  )
}

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation />}>
        <Route path="/home" element={<Home />} />
      </Route>
    </Routes>
  );
}; 

export default App;
